import React, { Component } from 'react';
import './Card.css'
class Card extends Component{
	render(){
		const {img, name} = this.props;
		return (
				<div className = 'Card'>
					<div className = 'logo'>
						<div className ='framework'>
							
						</div>
						<img src = {img} alt = {name} />						
						<img src = {img} alt = {name} />						
						<img src = {img} alt = {name} />
						<img src = {img} alt = {name} />
						<img src = {img} alt = {name} />
						<img src = {img} alt = {name} />												
					</div>
					<div className = 'Title'>
						<h3>{name}</h3> 
					</div>
				</div>	
			)
	}
}

export default Card;
